MongoDB Aggregate sum with lookup to another collection<p>There are 2 schemas. One is a CostCode and the other is a Timesheet. Each timesheet is associated to one or more cost codes. The Timesheet has a costCodes array and each item in this array contains a reference to a CostCode and hoursWorked. The result desired is to have a list of all CostCode documents where each doc includes a sum of hoursWorked from the Timesheets.</p>
<p><strong>CostCode Schema:</strong></p>
<pre><code>{
  label: { type: String, required: false },
  description: { type: String }
  budgetedHours: { type: Number, required: false },
}
</code></pre>
<p><strong>Timesheet Schema:</strong></p>
<pre><code>costCodes: [{
  costCode: { type: Schema.ObjectId, ref: 'CostCode' },
  percentage: { type: Number },
  hoursWorked: { type: Number },
}],
startDateTimeUTC: { type: Date, required: true },
endDateTimeUTC: { type: Date },
</code></pre>
<p><strong>Desired Result:</strong></p>
<pre><code>{
  _id: &quot;6447dedc26faeedd35b62c0c&quot;
  label: &quot;Cost Code 1&quot;
  description: &quot;&quot;
  budgetedHours: 100
  totalHoursWorked: 53
},
{
  _id: &quot;6445e11b27d9bbb7779bb89b&quot;
  label: &quot;Cost Code 2&quot;
  description: &quot;&quot;
  budgetedHours: 150
  totalHoursWorked: 42
}
</code></pre>

