Retrieving item count per date on MongoDB aggregate<p>I have a collection containing events. Each event is timestamped down to the millisecond. I would like to group the events in a count per day.
e.g.:</p>
<p>I have</p>
<pre><code>KEY       VALUE

_id       111222333444555ddd666fff
time      2023-04-23T15:35:19.631Z
type      pizza-event

_id       111222333444555ddd666fff
time      2023-04-23T01:41:20.631Z
type      TV-event

_id       111222333444555ddd666fff
time      2023-04-22T05:00:05.631Z
type      some-event
</code></pre>
<p>I would like</p>
<pre><code>KEY        VALUE

date       04-22-2023
count      1.0

date       04-23-2023
count      2.0
</code></pre>
<p>The ultimate goal is to use the query in a Golang project.</p>
<p>So far I have</p>
<pre><code>[
        {
            &quot;$match&quot; : {
                &quot;$and&quot; : [
                    {
                        &quot;type&quot; : &quot;foo.bar.event&quot;
                    },
                    {
                        &quot;time&quot; : {
                            &quot;$gte&quot; : ISODate(&quot;2023-04-23T00:00:00.000+0000&quot;)
                        }
                    },
                    {
                        &quot;time&quot; : {
                            &quot;$lte&quot; : ISODate(&quot;2023-04-25T00:00:00.000+0000&quot;)
                        }
                    }
                ]
            }
        }, 
        {
            &quot;$group&quot; : {
                &quot;_id&quot; : {
                    &quot;$dateToString&quot; : {
                        &quot;format&quot; : &quot;%m-%d-%Y&quot;,
                        &quot;date&quot; : &quot;$time&quot;
                    }
                },
                &quot;count&quot; : {
                    &quot;$sum&quot; : 1.0
                }
            }
        }
    ]
</code></pre>
<p>which returns</p>
<pre><code>KEY            VALUE

_id            04-24-2023
count          476.0

_id            04-23-2023
count          28.0
</code></pre>
<p>That could've worked but when I code this query in the go project a red squiggly appears under &quot;$dateToString&quot; with the message &quot;Invalid field name&quot; and ideally I would like the date to have a key of &quot;time&quot; instead of &quot;_id&quot;.  When I do following change in the group stage:</p>
<pre><code>{
    _id: null,
    &quot;date&quot;: {&quot;$dateToString&quot;: { &quot;format&quot;: &quot;%m-%d-%Y&quot;, &quot;date&quot;: &quot;$time&quot;}},
    &quot;count&quot;: {&quot;$sum&quot;: 1}
}
</code></pre>
<p>I get an unknown group operator &quot;$dateToString&quot; error. So I thought of creating the groups and then add a project stage for the &quot;$dateToString&quot; but now the group stage returns groups for every millisecond which defeats the point of grouping.</p>
<p>I realize I am discussing 2 different problems. However, while help with everything would be wonderful, this question is specifically about fixing the mongo query. I will return for the Golang coding on an other thread if necessary.
Let me know if I can be clearer.</p>

